"As a daughter of immigrant parents and a self-identifying LGBTQIA+ Asian-American rock climber, I often feel like a stranger in this land. The spaces I have the privilege to recreate on are not mine—and that’s exactly how I feel they should be treated.”⁠⁠⁠
⁠⁠⁠
@emmelinewang on finding the intersection of identity, stewardship and rock climbing. Follow the link in bio to read "Tread Lightly".

